import { Nav, Container } from "react-bootstrap";
import React from "react";

var style = {
  backgroundColor: "#F8F8F8",
  borderTop: "1px solid #E7E7E7",
  textAlign: "center",
  padding: "20px",
  position: "fixed",
  left: "0",
  bottom: "0",
  height: "60px",
  // #a3aab5
};

const Footer = () => {
  return (
    <div className="fixed-bottom">
      <Nav activeKey="/home">
        <Container>
          <Nav.Item>NetBlock</Nav.Item>
        </Container>
      </Nav>
    </div>
  );
};

export default Footer;
